import React, { useState } from 'react';
import './SellerInterface.css';
import logo from "../assets/images/BookTown.png";

const SellerInterface = () => {
  const [state, setState] = useState('Standard');
  const [bookDetails, setBookDetails] = useState({
    bookName: '',
    author: '',
    rentalPeriod: '',
    city: '',
    image: null,
    printRunNumber: '',
    paperbackType: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setBookDetails({ ...bookDetails, [name]: value });
  };

  const handleImageUpload = (e) => {
    setBookDetails({ ...bookDetails, image: e.target.files[0] });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const formData = new FormData();
    for (const key in bookDetails) {
      formData.append(key, bookDetails[key]);
    }

    try {
      const response = await fetch('http://127.0.0.1:5000/api/seller', {
        method: 'POST',
        body: formData,
      });
      const result = await response.json();
      if (response.ok) {
        alert('Book details submitted successfully!');
      } else {
        alert(`Error: ${result.message}`);
      }
    } catch (error) {
      console.error('Error submitting book details:', error);
    }
  };

  return (
    <div className="seller-interface">
      <nav className="navbar">
        <img src={logo} alt="Logo" className="logo" />
        
        <div className="nav-buttons">
          <button onClick={() => window.location.href = '/events'}>Upcoming Events</button>
          <button onClick={() => window.location.href = '/home'}>Home</button>
          <button onClick={() => window.location.href = '/sign-in'}>Logout</button>
        </div>
      </nav>

      <div className="form-container">
        <h2>Enter Book Details</h2>
        <form onSubmit={handleSubmit} encType="multipart/form-data">
          <label>
            Book Name:
            <input 
              type="text" 
              name="bookName" 
              value={bookDetails.bookName} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Author:
            <input 
              type="text" 
              name="author" 
              value={bookDetails.author} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Rental Period:
            <input 
              type="text" 
              name="rentalPeriod" 
              value={bookDetails.rentalPeriod} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            Seller's City:
            <input 
              type="text" 
              name="city" 
              value={bookDetails.city} 
              onChange={handleChange} 
              required 
            />
          </label>

          <label>
            State of the Book:
            <select 
              name="state" 
              value={state} 
              onChange={(e) => setState(e.target.value)}
            >
              <option value="Standard">Standard</option>
              <option value="Collectible">Collectible</option>
            </select>
          </label>

          {state === 'Collectible' && (
            <>
              <label>
                Print Run Number:
                <input 
                  type="text" 
                  name="printRunNumber" 
                  value={bookDetails.printRunNumber} 
                  onChange={handleChange} 
                />
              </label>

              <label>
                Paperback Type:
                <input 
                  type="text" 
                  name="paperbackType" 
                  value={bookDetails.paperbackType} 
                  onChange={handleChange} 
                />
              </label>
            </>
          )}

          <button type="submit">Submit</button>
        </form>
      </div>
    </div>
  );
};

export default SellerInterface;
